import React from 'react'
import { BrowserRouter as Router, Route, Link , Switch } from "react-router-dom";
import Markets from '../markets/markets.js';
import './banner.css'

function Grafits() {
  return <h2>About</h2>;
}

function Suport() {
  return <h2>Users</h2>;
}

function Banner () {

      return(
        <Router>
          <div className="banner">
                <div >
                  <Link to="../markets/index2.js" className="banner-bottom">Markets</Link>
                </div>
                <div >
                  <Link to="/grafits/" className="banner-bottom">Grafits</Link>
                </div>
                <div >
                  <Link to="/suport/" className="banner-bottom">Suport</Link>
                </div>
                <Switch>

                  <Route path="/about/" component={Grafits} />
                  <Route path="/users/" component={Suport} />
                </Switch>
          </div>
      </Router>

    )

}
export default Banner;
